import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const Orders = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');

    if (!token) {
      alert('Please login to view your orders');
      navigate('/login');
      return;
    }

    const fetchOrders = async () => {
      try {
        setLoading(true);
        const response = await axios.get('/api/orders/', {
          headers: {
            'Authorization': `Token ${token}`
          }
        });

        setOrders(response.data);
        setLoading(false);
      } catch (err) {
        console.error('Error fetching orders:', err);
        setError('Failed to load orders. Please try again.');
        setLoading(false);
      }
    };

    fetchOrders();
  }, [navigate]);

  if (loading) {
    return (
      <div className="container">
        <h1 className="mb-4">My Orders</h1>
        <p className="text-center py-5">Loading orders...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container">
        <h1 className="mb-4">My Orders</h1>
        <div className="alert alert-danger" role="alert">
          {error}
        </div>
      </div>
    );
  }

  return (
    <div className="container">
      <h1 className="mb-4">My Orders</h1>

      {orders.length === 0 ? (
        <div className="text-center py-5">
          <p>You haven't placed any orders yet.</p>
          <button 
            className="btn btn-primary"
            onClick={() => navigate('/menu')}
          >
            Browse Menu
          </button>
        </div>
      ) : (
        <div className="row">
          {orders.map(order => (
            <div key={order.id} className="col-md-6 mb-4">
              <div className="card">
                <div className="card-header d-flex justify-content-between align-items-center">
                  <span>Order #{order.id}</span>
                  <span className="badge bg-primary">
                    {order.delivered ? 'Delivered' : 'Pending'}
                  </span>
                </div>
                <div className="card-body">
                  <p className="card-text">
                    <strong>Date:</strong> {new Date(order.time_of_order).toLocaleString()}
                  </p>
                  <p className="card-text">
                    <strong>Total:</strong> ${order.price.toFixed(2)}
                  </p>
                  <p className="card-text">
                    <strong>Items:</strong>
                  </p>
                  <ul className="list-group mb-3">
                    {JSON.parse(order.order_detail).map((item, index) => (
                      <li key={index} className="list-group-item d-flex justify-content-between">
                        <div>
                          {item.name} × {item.quantity}
                          {item.size && <span className="text-muted"> ({item.size})</span>}
                        </div>
                        <span>${(item.price * item.quantity).toFixed(2)}</span>
                      </li>
                    ))}
                  </ul>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Orders;
